import React from 'react';
import { Navbar, Nav, NavItem, NavDropdown, Button , Form , FormControl} from 'react-bootstrap';


const Footer = () => {

    return (
        <Navbar bg="dark" expand="xl" className="footer">
            <p>Challenge </p>
         </Navbar>
    );

};

export default Footer;
